import * as React from "react";
import { StyleSheet,TouchableOpacity } from "react-native";
import { Avatar, Button, Card, Title, Paragraph } from "react-native-paper";

const LeftContent = (props) => <Avatar.Icon {...props} icon="folder" />;

function onPressingCard(){
  const onsubmit = () => {
    console.log(TextValue);
    axios
      .get(`https://pokeapi.co/api/v2/pokemon/${TextValue.toLowerCase()}`)
      .then((response) => {
        const data = response.data;
        // console.log(data);
        navigation.navigate("Details", { value: data });
      });
  };
}

const MyComponent = (item) => (

  <TouchableOpacity onPress={onPressingCard(item.data.pokemon)} >
  <Card style={styles.CardType}>
    <Card.Cover style={styles.imageStyle} source={{ uri: item.data.imageSrc}} />
    <Card.Content style={styles.cover}>{item.data.pokemon}</Card.Content>
    </Card>
    </TouchableOpacity>
);

export default MyComponent;
const styles = StyleSheet.create({
  imageStyle: {
    width: 300,
    height: 300,
    backgroundColor:'skyblue'
  },
  CardType: {
    flex: 1,
    alignContent: "space-between",
  },
  cover:{
    alignItems:'center',
    justifyContent:'center',
    alignContent:'center',
    fontWeight:'bold' }
});
